    <p class=MsoNormal align=center style='text-align:center'><span
    style='font-size:26.0pt;line-height:105%;font-family:Forte;color:black;
    background:white'>La&nbsp;</span><span style='font-size:26.0pt;line-height:
    105%;font-family:Forte'><a href="https://concepto.de/geografia/"
    style='box-sizing: border-box;background-color:rgba(0, 0, 0, 0);transition: color 0.125s ease-in-out 0s;
    font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;
    widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px'><span
    style='color:#E84E2B'>geografía</span></a><span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'><span
    style='color:black;background:white'>&nbsp;de África se destaca por&nbsp;</span></span><strong
    style='box-sizing: border-box;font-variant-ligatures: normal;font-variant-caps: normal;
    orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;text-decoration-thickness: initial;
    text-decoration-style: initial;text-decoration-color: initial;word-spacing:
    0px'><span style='font-family:Forte;mso-bidi-font-family:"Times New Roman";
    mso-bidi-theme-font:minor-bidi;color:black'>tres grandes&nbsp;<a
    href="https://concepto.de/desierto/" style='box-sizing: border-box;
    background-color:rgba(0, 0, 0, 0);transition: color 0.125s ease-in-out 0s'><span
    style='color:#E84E2B'>desiertos</span></a>: el Sahara (el más grande del mundo),
    el Namib y el Kalahari<span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'></span></strong><span
    style='color:black;background:white'>. Presenta un largo sistema montañoso
    en la&nbsp;</span></span><a href="https://concepto.de/region/"
    style='box-sizing: border-box;background-color:rgba(0, 0, 0, 0);transition: color 0.125s ease-in-out 0s;
    font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;
    widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px'><span
    style='color:#E84E2B'>región</span></a><span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'><span
    style='color:black;background:white'>&nbsp;este del continente, la
    Cordillera del Atlas, cuyo pico más alto es el Kilimanjaro (en Tanzania)
    con 5.895 metros y que está formado por 3&nbsp;</span></span><a
    href="https://concepto.de/volcan/" style='box-sizing: border-box;
    background-color:rgba(0, 0, 0, 0);transition: color 0.125s ease-in-out 0s;
    font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;
    widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px'><span
    style='color:#E84E2B'>volcanes</span></a><span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'><span
    style='color:black;background:white'>&nbsp;inactivos (el Shira, el Mawenzi
    y el Kibo).</span></span><span style='color:black'><br style='box-sizing: border-box'>
    <span style='box-sizing: border-box;font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;word-spacing:0px'><br style='box-sizing: border-box'>
    <br style='box-sizing: border-box'>
    <i><span style='mso-spacerun:yes'> </span><o:p></o:p></i></span></span></p>
    </span></div>
